import React, { Component } from 'react';

class GetExample extends Component {
  constructor(props){
    super(props);

    this.state = {
      names: []
    }
  }

  componentDidMount() {
    // Simple GET request using fetch
    fetch('localhost:3000/api/item/all')
        .then(response => response.json())
        .then(data => this.setState({ names: data.name }));
}

  render() {
    return (<div>
        List of posts
    </div>);
  }
}

export default GetExample;
